//Database of local fields
declare type MyDB;
declare attributes MyDB: Precomputed, Data;

function flatten(L);
	return [Li : Li in L];
end function;

intrinsic LocalFieldDatabase(L::[]) -> MyDB
{A database of local fields which caches all degree d extensions
of Qp described in L, in the format <p,d>}
	D := New(MyDB);
	data := [];
	for l in L do
		p := l[1];
		d := l[2];
		if p eq 2 and d eq 8 then
			Append(~data, Octic2Adics());
		elif p eq 5 and d eq 10 then
			Append(~data, Decic5Adics());
		else
			Append(~data, flatten(AllExtensions(pAdicRing(p,500), d)));
		end if;
	end for;
	D`Data := data;
	D`Precomputed := L;
	return D;
end intrinsic;

intrinsic LocalFieldDatabase() -> MyDB
{A database of local fields}
	return LocalFieldDatabase([]);
end intrinsic;

intrinsic LocalFieldDatabaseOctic2Adics() -> MyDB
{A database of local fields, with all degree 8 extensions
of Q2 cached}
	return LocalFieldDatabase([<2,8>]);
end intrinsic;

intrinsic LocalFieldDatabaseDecic5Adics() -> MyDB
{A database of local fields, with all degree 8 extensions
of Q2 cached}
	return LocalFieldDatabase([<5,10>]);
end intrinsic;

intrinsic Print(D::MyDB)
{Print D}
	printf "A database of local fields with cached extensions: %o", D`Precomputed;
end intrinsic;

intrinsic AllExtensions(D::MyDB, R::FldPad, n::RngIntElt:
	Ediv := 1,
	Emin := 1,
	Emax := n) -> SeqEnum
{Uses Magma together with optionally precomputed extensions of Qp and
Jones and Roberts list of octic extensions of Q2 to compute extensions
of local fields faster}
	require Emin le Emax: "Emin must be smaller or equal to Emax";
	p := Prime(R);
	i := Index(D`Precomputed, <p, n>);
	if i ne 0 then
		if Emin eq 1 and Emax eq n then
			return D`Data[i];
		else
			return [E : E in D`Data[i] | Emin le RamificationDegree(E) and RamificationDegree(E) le Emax and RamificationDegree(E) mod Ediv eq 0];
		end if;
	elif Emin eq 1 and Emax eq n and Ediv eq 1 then 
		return [FieldOfFractions(S) : S in flatten(AllExtensions(R, n))];
	else
		return [FieldOfFractions(S) : S in flatten([AllExtensions(R, n: E := e) : e in Divisors(n) | Emin le e and e le Emax and e mod Ediv eq 0])];
	end if;
end intrinsic;

